import React, {Component} from 'react';
import UserBox from './UserBox';

const UserList = () => {
    let users = [
        {
            id:"01",
            nombre:"Nombre1",
            apellido:"Apellido1",
            password:"password1",
            comuna:"comuna1"
        },
        {
            id:"02",
            nombre:"Nombre2",
            apellido:"Apellido2",
            password:"password2",
            comuna:"comuna2"   
        }
    ];

    return(
        <div>
            {users.map(user => {
                <div>
                 <UserBox id={user.id} nombre={user.nombre} apellido={user.apellido} comuna={user.comuna} />
                </div>
            })}
        </div>
    )
}

export default UserList;
